Normally, you can set up your data from systems . Use Commands from regular systems, or use exclusive systems to get full World access . Add your setup systems as startup systems for things you want to initialize at launch, or use state enter/exit systems to do things when transitioning between menus, game modes, levels, etc. However, you can also initialize data directly from the app builder. This is common for resources , if they need to be present at all times. You can also get direct World access . // Create (or overwrite) resource with specific value
app.insert_resource(StartingLevel(3)); // Ensure resource exists; if not, create it
// (using `Default` or `FromWorld`)
app.init_resource::<MyFancyResource>(); // We can also access/manipulate the World directly
// (in this example, to spawn an entity, but you can do anything)
app.world.spawn(SomeBundle::default());

