Bevy Version: 0.11 (current) Relevant official examples: ecs_guide , startup_system , system_param . Systems are pieces of functionality, which are run by Bevy. They are typically implemented using regular Rust functions. This is how you implement all your game logic. Each system specifies what data it needs to access to do its thing, and Bevy will run them in parallel when possible. You can add configuration/metadata to control how your systems should be run, using the app builder . These functions can only take special parameter types , to specify what data you need access to. If you use unsupported parameter types in your function, you will get confusing compiler errors! Some of the possibilities are: accessing resources using Res / ResMut accessing components of entities using queries ( Query ) creating/destroying entities, components, and resources using Commands ( Commands ) sending/receiving events using EventWriter / EventReader See here for a full list! fn debug_start( // access resource start: Res<StartingLevel>
) { eprintln!("Starting on level {:?}", *start);
} System parameters can be grouped into tuples (which can be nested). This is useful for organization. fn complex_system( (a, mut b): (Res<ResourceA>, ResMut<ResourceB>), // this resource might not exist, so wrap it in an Option mut c: Option<ResMut<ResourceC>>,
) { if let Some(mut c) = c { // do something }
} Your function can have a maximum of 16 total parameters. If you need more, group them into tuples to work around the limit. Tuples can contain up to 16 members, but can be nested indefinitely. There is also a different kind of systems: exclusive systems . They have full direct access to the ECS World , so you can access any data you want and do anything, but cannot run in parallel. For most use cases, you should use regular parallel systems.

