Bevy Version: 0.11 (current) Relevant official examples: ecs_guide . Resources allow you to store a single global instance of some data type, independently of entities . Use them for data that is truly global for your app, such as configuration / settings. Resources make it easy for you to access such data from anywhere. To create a new resource type, simply define a Rust struct or enum, and derive the Resource trait, similar to components and events . #[derive(Resource)]
struct GoalsReached { main_goal: bool, bonus: u32,
} Types must be unique; there can only be at most one instance of a given type. If you might need multiple, consider using entities and components instead. Bevy uses resources for many things . You can use these builtin resources to access various features of the engine. They work just like your own custom types.

