If you need to create/remove resources at runtime, you can do so using commands ( Commands ): fn my_setup(mut commands: Commands, /* ... */) { // add (or overwrite) resource, using the provided data commands.insert_resource(GoalsReached { main_goal: false, bonus: 100 }); // ensure resource exists (creating if necessary) commands.init_resource::<MyFancyResource>(); // remove a resource (if it exists) commands.remove_resource::<MyOtherResource>();
} Alternatively, using direct World access from an exclusive system : fn my_setup2(world: &mut World) { // The same methods as with Commands are also available here, // but we can also do fancier things: // Check if resource exists if !world.contains_resource::<MyFancyResource>() { // Get access to a resource, inserting a custom value if unavailable let _bonus = world.get_resource_or_insert_with( || GoalsReached { main_goal: false, bonus: 100 } ).bonus; }
} Resources can also be set up from the app builder . Do this for resources that are meant to always exist from the start. App::new() .add_plugins(DefaultPlugins) .insert_resource(StartingLevel(3)) .init_resource::<MyFancyResource>() // ...

