Implement Default for simple resources: // simple derive, to set all fields to their defaults
#[derive(Resource, Default)]
struct GameProgress { game_completed: bool, secrets_unlocked: u32,
} #[derive(Resource)]
struct StartingLevel(usize); // custom implementation for unusual values
impl Default for StartingLevel { fn default() -> Self { StartingLevel(1) }
} // on enums, you can specify the default variant
#[derive(Resource, Default)]
enum GameMode { Tutorial, #[default] Singleplayer, Multiplayer,
} For resources that need complex initialization, implement FromWorld : #[derive(Resource)]
struct MyFancyResource { /* stuff */ } impl FromWorld for MyFancyResource { fn from_world(world: &mut World) -> Self { // You have full access to anything in the ECS World from here. // For example, you can access (and mutate!) other resources: let mut x = world.resource_mut::<MyOtherResource>(); x.do_mut_stuff(); MyFancyResource { /* stuff */ } }
} Beware: it can be easy to get yourself into a mess of unmaintainable code if you overuse FromWorld to do complex things.

