Bundles are like "templates", to make it easy to create entities with a common set of components. #[derive(Bundle)]
struct PlayerBundle { xp: PlayerXp, name: PlayerName, health: Health, _p: Player, // We can nest/include another bundle. // Add the components for a standard Bevy Sprite: #[bundle] sprite: SpriteSheetBundle,
} Bevy also considers arbitrary tuples of components as bundles: (ComponentA, ComponentB, ComponentC) Note that you cannot query for a whole bundle. Bundles are just a convenience when creating the entities. Query for the individual component types that your system needs to access.

