Add query filters to narrow down the entities you get from the query. This is done using the second (optional) generic type parameter of the Query type. Note the syntax of the query: first you specify the data you want to access (using a tuple to access multiple things), and then you add any additional filters (can also be a tuple, to add multiple). Use With / Without to only get entities that have specific components. fn debug_player_hp( // access the health (and optionally the PlayerName, if present), only for friendly players query: Query<(&Health, Option<&PlayerName>), (With<Player>, Without<Enemy>)>,
) { // get all matching entities for (health, name) in query.iter() { if let Some(name) = name { eprintln!("Player {} has {} HP.", name.0, health.hp); } else { eprintln!("Unknown player has {} HP.", health.hp); } }
} This is useful if you don't actually care about the data stored inside these components, but you want to make sure that your query only looks for entities that have (or not have) them. If you want the data, then put the component in the first part of the query (as shown previously), instead of using a filter. Multiple filters can be combined: in a tuple to apply all of them (AND logic) using the Or<(…)> wrapper to detect any of them (OR logic). (note the tuple inside)

