Bevy Version: 0.11 (current) Relevant official examples: event . Send data between systems! Let your systems communicate with each other! Like resources or components , events are simple Rust structs or enums. When creating a new event type, derive the Event trait. Then, any system can send (broadcast) values of that type, and any system can receive those events. To send events, use an EventWriter<T> . To receive events, use an EventReader<T> . Every reader tracks the events it has read independently, so you can handle the same events from multiple systems . #[derive(Event)]
struct LevelUpEvent(Entity); fn player_level_up( mut ev_levelup: EventWriter<LevelUpEvent>, query: Query<(Entity, &PlayerXp)>,
) { for (entity, xp) in query.iter() { if xp.0 > 1000 { ev_levelup.send(LevelUpEvent(entity)); } }
} fn debug_levelups( mut ev_levelup: EventReader<LevelUpEvent>,
) { for ev in ev_levelup.iter() { eprintln!("Entity {:?} leveled up!", ev.0); }
} You need to register your custom event types via the app builder : app.add_event::<LevelUpEvent>();

