Bevy Version: 0.9 (outdated!) Relevant official examples: ecs_guide . Local resources allow you to have per- system data. This data is not stored in the ECS World, but rather together with your system. Local<T> is a system parameter similar to ResMut<T> , which gives you full mutable access to an instance of some data type, that is independent from entities and components. Res<T> / ResMut<T> refer to a single global instance of the type, shared between all systems. On the other hand, every Local<T> parameter is a separate instance, exclusively for that system. #[derive(Default)]
struct MyState; fn my_system1(mut local: Local<MyState>) { // you can do anything you want with the local here
} fn my_system2(mut local: Local<MyState>) { // the local in this system is a different instance
} The type must implement Default or FromWorld . It is automatically initialized. A system can have multiple Local s of the same type.

