For more advanced use cases, you can use labels . Labels can either be strings, or custom types (like enums) that derive SystemLabel. This allows you to affect multiple systems at once, with the same constraints. You can place multiple labels on one system. You can also use the same label on multiple systems. Each label is a reference point that other systems can be ordered around. #[derive(Debug, Clone, Copy, PartialEq, Eq, Hash)]
#[derive(SystemLabel)]
enum MyLabel { /// everything that handles input Input, /// everything that updates player state Player, /// everything that moves things (works with transforms) Movement, /// systems that update the world map Map,
} fn main() { App::new() .add_plugins(DefaultPlugins) // use labels, because we want to have multiple affected systems .add_system(input_joystick.label(MyLabel::Input)) .add_system(input_keyboard.label(MyLabel::Input)) .add_system(input_touch.label(MyLabel::Input)) .add_system(input_parameters.before(MyLabel::Input)) .add_system( player_movement .before(MyLabel::Map) .after(MyLabel::Input) // we can have multiple labels on this system .label(MyLabel::Player) .label(MyLabel::Movement) // can also use loose strings as labels .label("player_movement") ) // … and so on … .run();
} When you have multiple systems with common labels or ordering, it may be convenient to use system sets .

