Bevy Version: 0.9 (outdated!) Relevant official examples: state . States allow you to structure the runtime "flow" of your app. This is how you can implement things like: A menu screen or a loading screen Pausing / unpausing the game Different game modes … In every state, you can have different systems running. You can also add one-shot setup and cleanup systems to run when entering or exiting a state. To use states, define an enum type and add system sets to your app builder : #[derive(Debug, Clone, Eq, PartialEq, Hash)]
enum AppState { MainMenu, InGame, Paused,
} fn main() { App::new() .add_plugins(DefaultPlugins) // add the app state type .add_state(AppState::MainMenu) // add systems to run regardless of state, as usual .add_system(play_music) // systems to run only in the main menu .add_system_set( SystemSet::on_update(AppState::MainMenu) .with_system(handle_ui_buttons) ) // setup when entering the state .add_system_set( SystemSet::on_enter(AppState::MainMenu) .with_system(setup_menu) ) // cleanup when exiting the state .add_system_set( SystemSet::on_exit(AppState::MainMenu) .with_system(close_menu) ) .run();
} It is OK to have multiple system sets for the same state. This is useful when you want to place labels and use explicit system ordering . This can also be useful with Plugins . Each plugin can add its own set of systems to the same state. States are implemented using run criteria under the hood. These special system set constructors are really just helpers to automatically add the state management run criteria.

159.body:
Inside of systems, you can check and control the state using the State<T> resource: fn play_music( app_state: Res<State<AppState>>, // ...
) { match app_state.current() { AppState::MainMenu => { // TODO: play menu music } AppState::InGame => { // TODO: play game music } AppState::Paused => { // TODO: play pause screen music } }
} To change to another state: fn enter_game(mut app_state: ResMut<State<AppState>>) { app_state.set(AppState::InGame).unwrap(); // ^ this can fail if we are already in the target state // or if another state change is already queued
} After the systems of the current state complete, Bevy will transition to the next state you set. You can do arbitrarily many state transitions in a single frame update. Bevy will handle all of them and execute all the relevant systems (before moving on to the next stage ).

