Bevy Version: 0.9 (outdated!) Relevant official examples: plugin , plugin_group . As your project grows, it can be useful to make it more modular. You can split it into "plugins". Plugins are simply collections of things to be added to the App Builder . Think of this as a way to add things to the app from multiple places, like different Rust files/modules or crates. struct MyPlugin; impl Plugin for MyPlugin { fn build(&self, app: &mut App) { app .init_resource::<MyOtherResource>() .add_event::<MyEvent>() .add_startup_system(plugin_init) .add_system(my_system); }
} fn main() { App::new() .add_plugins(DefaultPlugins) .add_plugin(MyPlugin) .run();
} Note how you get &mut access to the App , so you can add whatever you want to it, just like you can do from your fn main. For internal organization in your own project, the main value of plugins comes from not having to declare all your Rust types and functions as pub, just so they can be accessible from fn main to be added to the app builder. Plugins let you add things to your app from multiple different places, like separate Rust files / modules. You can decide how plugins fit into the architecture of your game. Some suggestions: Create plugins for different states . Create plugins for various sub-systems, like physics or input handling.

