Plugin groups register multiple plugins at once. Bevy's DefaultPlugins and MinimalPlugins are examples of this. To create your own plugin group: struct MyPluginGroup; impl PluginGroup for MyPluginGroup { fn build(self) -> PluginGroupBuilder { PluginGroupBuilder::start::<Self>() .add(FooPlugin) .add(BarPlugin) }
} fn main() { App::new() .add_plugins(DefaultPlugins) .add_plugins(MyPluginGroup) .run();
