Changed detection is triggered by DerefMut . Simply accessing components via a mutable query, without actually performing a &mut access, will not trigger it. This makes change detection quite accurate. You can rely on it to optimize your game's performance, or to otherwise trigger things to happen. Also note that when you mutate a component, Bevy does not track if the new value is actually different from the old value. It will always trigger the change detection. If you want to avoid that, simply check it yourself: fn update_player_xp( mut query: Query<&mut PlayerXp>,
) { for mut xp in query.iter_mut() { let new_xp = maybe_lvl_up(&xp); // avoid triggering change detection if the value is the same if new_xp != *xp { *xp = new_xp; } }
} Change detection works on a per- system granularity, and is reliable. A system will not detect changes that it made itself, only those done by other systems, and only if it has not seen them before (the changes happened since the last time it ran). If your system only runs sometimes (such as with states or run criteria ), you do not have to worry about missing changes.

