commands.entity(parent).push_children(&[child]); // you can also use `with_children`:
commands.spawn(MyParentBundle::default()) .with_children(|parent| { parent.spawn(MyChildBundle::default()); }); Note that this only sets up the Parent and Children components, and nothing else. Notably, it does not add transforms or visibility for you. If you need that functionality, you need to add those components yourself, using something like SpatialBundle . You can despawn an entire hierarchy with a single command : fn close_menu( mut commands: Commands, query: Query<Entity, With<MainMenuUI>>,
) { for entity in query.iter() { // despawn the entity and its children commands.entity(entity).despawn_recursive(); }
