Bevy Version: 0.9 (outdated!) Relevant official examples: asset_loading . To load assets from files, use the AssetServer resource . #[derive(Resource)]
struct UiFont(Handle<Font>); fn load_ui_font( mut commands: Commands, server: Res<AssetServer>
) { let handle: Handle<Font> = server.load("font.ttf"); // we can store the handle in a resource: // - to prevent the asset from being unloaded // - if we want to use it to access the asset later commands.insert_resource(UiFont(handle));
} This queues the asset loading to happen in the background, and return a handle . The asset will take some time to become available. You cannot access the actual data immediately in the same system , but you can use the handle. You can spawn entities like your 2D sprites, 3D models, and UI, using the handle, even before the asset has loaded. They will just "pop in" later, when the asset becomes ready. Note that it is OK to call asset_server.load(…) as many times as you want, even if the asset is currently loading, or already loaded. It will just provide you with the same handle. Every time you call it, it will just check the status of the asset, begin loading it if needed, and give you a handle. Bevy supports loading a variety of asset file formats , and can be extended to support more. The asset loader implementation to use is selected based on the file extension.

