Bevy Version: 0.9 (outdated!) Click here for the full example code. Note : this example is showing you how to do something not officially supported/endorsed by Bevy. Do at your own risk. Camera with a custom projection (not using one of Bevy's standard perspective or orthographic projections). You could also use this to change the coordinate system, if you insist on using something other than Bevy's default coordinate system , for whatever reason. Here we implement a simple orthographic projection that maps -1.0 to 1.0 to the vertical axis of the window, and respects the window's aspect ratio for the horizontal axis: See how Bevy constructs its camera bundles, for reference: 2d 3d This example is based on the setup for a 2D camera: use bevy::core_pipeline::tonemapping::Tonemapping;
use bevy::render::primitives::Frustum;
use bevy::render::camera::{Camera, CameraProjection};
use bevy::render::view::VisibleEntities; #[derive(Component, Debug, Clone, Reflect)]
#[reflect(Component, Default)]
struct SimpleOrthoProjection { near: f32, far: f32, aspect: f32,
} impl CameraProjection for SimpleOrthoProjection { fn get_projection_matrix(&self) -> Mat4 { Mat4::orthographic_rh( -self.aspect, self.aspect, -1.0, 1.0, self.near, self.far ) } // what to do on window resize fn update(&mut self, width: f32, height: f32) { self.aspect = width / height; } fn far(&self) -> f32 { self.far }
} impl Default for SimpleOrthoProjection { fn default() -> Self { Self { near: 0.0, far: 1000.0, aspect: 1.0 } }
} fn setup(mut commands: Commands) { // We need all the components that Bevy's built-in camera bundles would add // Refer to the Bevy source code to make sure you do it correctly: // here we show a 2d example let projection = SimpleOrthoProjection::default(); // position the camera like bevy would do by default for 2D: let transform = Transform::from_xyz(0.0, 0.0, projection.far - 0.1); // frustum construction code copied from Bevy let view_projection = projection.get_projection_matrix() * transform.compute_matrix().inverse(); let frustum = Frustum::from_view_projection( &view_projection, &transform.translation, &transform.back(), projection.far, ); commands.spawn(( bevy::render::camera::CameraRenderGraph::new(bevy::core_pipeline::core_2d::graph::NAME), projection, frustum, transform, GlobalTransform::default(), VisibleEntities::default(), Camera::default(), Camera2d::default(), Tonemapping::Disabled, ));
} fn main() { // need to add bevy-internal camera projection management functionality // for our custom projection type use bevy::render::camera::CameraProjectionPlugin; App::new() .add_plugins(DefaultPlugins) .add_startup_system(setup) .add_plugin(CameraProjectionPlugin::<SimpleOrthoProjection>::default()) .run();
}

